import axios from "axios";
import { useEffect, useState } from "react";
import "./boardagent.css";

function BoardAgent(){

    const API_URL = "http://localhost:8090/api/clients/"
    const [totalNumberOfClients, setTotalNumberOfClients] = useState(null);
    
    useEffect(()=>{
        getTotalNumberOfClients();
    },[])

    const getTotalNumberOfClients = () =>{
        return axios.get(API_URL + "count").then((response) => {
            console.log(response.data)
            setTotalNumberOfClients(response.data);
        })
    }
    return (
        <div className="card-columns">
            <div className="card bg-primary">
                <div className="card-body text-center">
                    <h3><i className="bi bi-people-fill"></i></h3>
                    <p className="card-text">Total Clients: {totalNumberOfClients}</p>
                </div>
            </div>
            <div className="card bg-warning">
                <div className="card-body text-center">
                    <p className="card-text">Some text inside the second card</p>
                </div>
            </div>
            <div className="card bg-success">
                <div className="card-body text-center">
                    <p className="card-text">Some text inside the third card</p>
                </div>
            </div>
            <div className="card bg-danger">
                <div className="card-body text-center">
                    <p className="card-text">Some text inside the fourth card</p>
                </div>
            </div>
            <div className="card bg-light">
                <div className="card-body text-center">
                    <p className="card-text">Some text inside the fifth card</p>
                </div>
            </div>
            <div className="card bg-info">
                <div className="card-body text-center">
                    <p className="card-text">Some text inside the sixth card</p>
                </div>
            </div>
      </div>
    );
};
export default BoardAgent;
